import React, { Component } from 'react';
import './App.css';
import NewIdeaForm from './NewIdeaForm.js'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>IdeaBox</h1>
        </header>
        <NewIdeaForm />
      </div>
    );
  }
}

export default App;
